            <form>
                <label>
                Work Time:
                </label>
                <input type="number" required
                       name="workTime"
                       value={props.workTime}
                       onChange={props.handleChange}/>
                <label> 
                min
                </label>
            </form>
            </span>

        </div>
        )
}

export default timerForm;
